import React, { useRef, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Webcam from 'react-webcam';
import { Button, Typography, Container, Card, CardContent, CircularProgress } from '@mui/material';
import { useSpring, animated } from 'react-spring';
import styled from 'styled-components';
import { browserSupportsWebAuthn } from '@simplewebauthn/browser';

const Challenge4Container = styled(Container)`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: linear-gradient(135deg, #f5f7fa, #c3cfe2);
  padding: 2rem;
`;

const WebcamCard = styled(Card)`
  margin: 1rem;
  max-width: 600px;
  width: 100%;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
`;

const StatusMessage = styled(Typography)`
  margin-top: 1rem;
  color: #333;
`;

const AnimatedButton = styled(animated(Button))`
  margin: 1rem;
`;

const Challenge4 = () => {
  const [faceScanStatus, setFaceScanStatus] = useState('Not Scanned');
  const [fingerprintStatus, setFingerprintStatus] = useState('Not Scanned');
  const [photoTaken, setPhotoTaken] = useState(false);
  const [authenticating, setAuthenticating] = useState(false);
  const [fingerprintData, setFingerprintData] = useState(null); // State to store fingerprint data
  const navigate = useNavigate();
  const webcamRef = useRef(null);

  // Animation for button
  const buttonProps = useSpring({
    opacity: 1,
    from: { opacity: 0 },
    reset: true,
    config: { duration: 500 }
  });

  // Capture Face
  const captureFace = React.useCallback(() => {
    const imageSrc = webcamRef.current.getScreenshot();
    console.log('Captured photo:', imageSrc);
    setFaceScanStatus('Scanning...');
    setPhotoTaken(true);

    // Simulate face recognition success or failure
    setTimeout(() => {
      if (Math.random() > 0.5) { // Simulated random success or failure
        setFaceScanStatus('Face recognized');
        startFingerprintAuth(); // Proceed to fingerprint authentication
      } else {
        setFaceScanStatus('Face not recognized. Try again.');
        setPhotoTaken(false);
      }
    }, 3000); // Simulated delay
  }, []);

  // Simulate and store fingerprint data
  const startFingerprintAuth = async () => {
    if (!browserSupportsWebAuthn()) {
      alert('WebAuthn is not supported in your browser.');
      return;
    }

    setAuthenticating(true);
    try {
      // Simulate fingerprint scanning
      setTimeout(() => {
        const simulatedFingerprint = 'simulatedFingerprintData'; // Replace with actual data in a real scenario
        setFingerprintData(simulatedFingerprint); // Store simulated fingerprint data
        setFingerprintStatus('Fingerprint scanned and stored');
        navigate('/final');
        setAuthenticating(false);
      }, 2000); // Simulated 2-second delay
    } catch (error) {
      console.error('Error during fingerprint authentication:', error);
      setFingerprintStatus('Authentication error. Try again.');
      setAuthenticating(false);
    }
  };

  return (
    <Challenge4Container>
      <Typography variant="h4" gutterBottom>
        Challenge 4: Face Scan and Fingerprint Authentication
      </Typography>
      <WebcamCard>
        <CardContent>
          <Webcam
            audio={false}
            ref={webcamRef}
            screenshotFormat="image/jpeg"
            width="100%"
          />
        </CardContent>
      </WebcamCard>
      <AnimatedButton
        variant="contained"
        color="primary"
        onClick={captureFace}
        disabled={photoTaken}
        style={buttonProps}
      >
        {photoTaken ? 'Photo Taken' : 'Take Photo'}
      </AnimatedButton>
      <StatusMessage variant="h6">
        Status: {faceScanStatus}
      </StatusMessage>
      {photoTaken && (
        <div>
          <Typography variant="h5" gutterBottom>
            Fingerprint Authentication
          </Typography>
          <AnimatedButton
            variant="contained"
            color="secondary"
            onClick={startFingerprintAuth}
            disabled={authenticating}
            style={buttonProps}
          >
            {authenticating ? <CircularProgress size={24} /> : 'Authenticate Fingerprint'}
          </AnimatedButton>
          <StatusMessage variant="h6">
            Status: {fingerprintStatus}
          </StatusMessage>
          {fingerprintData && (
            <Typography variant="body1" color="textSecondary">
              Stored Fingerprint Data: {fingerprintData}
            </Typography>
          )}
        </div>
      )}
    </Challenge4Container>
  );
};

export default Challenge4;
